oxy_webhelp_navlinks = {"cal_troubleshooting.dita-d4800e2951":{"topics":[{"title":"Once I have created a meeting, how do I make it repeat?","shortdesc":"<p class=\"shortdesc\">Once you have saved a meeting and sent invitations, you cannot make it a repeating meeting. However, you can easily copy the information into a new meeting automatically. <\/p>","href":"cal_make_mtg_repeat_t.html","attributes":{"data-id":"cal_make_mtg_repeat.dita"},"menu":{"hasChildren":false},"tocID":"cal_make_mtg_repeat.dita-d4800e2962","topics":[]},{"title":"How do I accept a meeting I previously declined?","shortdesc":"<p class=\"shortdesc\">If you set the preference to remove meetings from your Inbox after you process them, it may be difficult to find a meeting you have declined. However, you can use the <span class=\"ph uicontrol\">Entries and Notices<\/span> view on your calendar to find these invitations.<\/p>","href":"cal_accept_declined_t.html","attributes":{"data-id":"cal_accept_declined.dita"},"menu":{"hasChildren":false},"tocID":"cal_accept_declined.dita-d4800e2973","topics":[]},{"title":"What do I do if Notes displays the wrong time?","shortdesc":"<p class=\"shortdesc\">By default, NotesÂ® uses the time zone and daylight-saving time settings of your operating system. If you experience problems with the times displayed in Notes, check the operating system's time zone and daylight-saving time settings to make sure they are properly configured.<\/p>","href":"cal_wrongtime_c.html","attributes":{"data-id":"cal_dst_c"},"menu":{"hasChildren":false},"tocID":"cal_dst_c-d4800e2987","topics":[]}]}};